import './App.css';
import { Regions, Wine, WineList } from './components';

function App() {
  return (
    <div class="container">
      <h1 class="center-align">Open Wine Database</h1>
      <div class="row">
        <Regions />
        <WineList />
        <Wine />
      </div>
    </div>

  );
}

export default App;
